import Home from './components/Home/Home'
import { BrowserRouter, Switch, Route } from 'react-router-dom';


const App = () => {
  <BrowserRouter>
    <Container maxWidth='lg'>
      <Navbar></Navbar>
      <Switch>
        <Route exact path="/" component={Home}></Route>
        <Route exact path="/auth" component={Auth}></Route>
      </Switch>
      <Home></Home>
